export const transformUser = (dbUser) => {
    console.log(`in transformUser dbUser.login = ${dbUser.login} dbUser.roleId = ${dbUser.roleId}`)

    return ({
    id: dbUser.id,
    login:  dbUser.login,
    password:   dbUser.password,
    registredAt:    dbUser.registredAt,
    roleId: dbUser.roleId,
    })

}
